CREATE TABLE public."Refresh_Token"
(
    user_id integer NOT NULL,
    token character varying(512) NOT NULL,
    PRIMARY KEY (user_id,token),
    FOREIGN KEY (user_id)
        REFERENCES public."User" (user_id) MATCH SIMPLE
