CREATE TABLE public."STS_Entry"
(
    sts_entry_id serial NOT NULL,
    sts_id integer NOT NULL,
    manager_id integer NOT NULL,
    entry_time timestamp NOT NULL,
    departure_time timestamp,
    vehicle_id integer DEFAULT NULL,
    contract_company_id integer DEFAULT NULL,
    contract_vehicle text NOT NULL DEFAULT 'N/A',
    volume double precision NOT NULL,
    PRIMARY KEY (sts_entry_id),
    FOREIGN KEY (sts_id)
        REFERENCES public."STS" (sts_id) MATCH SIMPLE
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    FOREIGN KEY (manager_id)
        REFERENCES public."User" (user_id) MATCH SIMPLE
        ON UPDATE CASCADE
        ON DELETE SET NULL,
    FOREIGN KEY (vehicle_id)
        REFERENCES public."Vehicle" (vehicle_id) MATCH SIMPLE
        ON UPDATE CASCADE
        ON DELETE SET NULL
);







CREATE TABLE public."Bill"
(
    bill_id serial NOT NULL,
    vehicle_id integer NOT NULL,
    landfill_id integer NOT NULL,
    sts_id integer NOT NULL,
    amount double precision NOT NULL,
    distance double precision NOT NULL,
    timestamp timestamp NOT NULL,
    PRIMARY KEY (bill_id),
    FOREIGN KEY (vehicle_id)
        REFERENCES public."Vehicle" (vehicle_id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    FOREIGN KEY (landfill_id)
        REFERENCES public."Landfill" (landfill_id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    FOREIGN KEY (sts_id)
        REFERENCES public."STS" (sts_id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
);



